function List(props){
    const {data} = props;
    console.log(props)
    const List=data.map((e,i)=>{
        console.log(i)
      return(
        <li>Id : {i+1}<br/> Name : {e.name}, <br/>Branch : {e.branch}</li>
      )  
    })
    return(
        <ul>
          {List}
        </ul>
    )
  }
  export default List;
